        visited.add(u)
        for v, w in graph[u]:
            if v not in visited:
                dfs(v, visited)
        return len(visited)

    def bfs(u: int, visited: set[int]) -> int:
        visited.add(u)
        queue = deque([u])
        while queue:
            u = queue.popleft()
            for v, w in graph[u]:
                if v not in visited:
                    visited.add(v)
                    queue.append(v)
        return len(visited)

    def dfs_bfs(u: int, visited: set[int]) -> int:
        visited.add(u)
        dfs_visited = dfs(u, visited)
        bfs_visited = bfs(u, visited)
        return min(dfs_visited, bfs_visited)

    def dfs_bfs_clients(u: int, visited: set[int], clients: dict[int, int]) -> int:
        visited.add(u)
        dfs_visited = dfs(u, visited)
        bfs_visited = bfs(u, visited)
        if dfs_visited == bfs_visited:
            return dfs_visited

        for v, w in graph[u]:
            if v not in visited:
                dfs_bfs_clients(v, visited, clients)

        if dfs_visited < bfs_visited:
            clients[u] = dfs_visited
        else:
            clients[u] = bfs_visited

    clients_visited = set()
    for u in clients:
        dfs_bfs_clients(u, clients_visited, clients)

    return str(len(clients_visited))

